import { FaCheck } from "react-icons/fa";

const Tabs = (props) => {
    return (
        <>
            {
                props.button.map((cur) => {
                    return <>
                        <button className='tab-button text-[16px] font-[400] leading-[1.5em] text-[#212529] mr-[30px]'>{cur}</button>

                    </>
                })
            }
        </>
    )
}


const TabsContent = (props) => {
    return (
        <>
            {
                props.Content.map((cur) => {
                    return <>
                        <div className="tab-content">
                            {cur}
                        </div>

                    </>
                })
            }
        </>
    )
}

export  { Tabs, TabsContent }
